import React from "react";

const ArraySchedule = () => {
    const Schedule = new Array(250);
    const Course = [['TE1',4],['TE1',4],['TE1',4],['TE1',3],['TE1',4],['TE1',2],['TE1',4],['TE1',4],['TE1',4],['TE1',3]];
    const random1 = Course[Math.floor(Math.random()*Schedule.length)];
    console.log("Random: " +random1);
    return(
        <React.Fragment>
            {random1}
        </React.Fragment>
    );
}

export default ArraySchedule;
